int counterStart = 1
int i, counter

//Pobranie z TestSuite informacji o środowisku, porcie i kodzie sprzedawcy
String _Srodowisko = testRunner.testCase.testSuite.getPropertyValue("Srodowisko")
testRunner.testCase.setPropertyValue("srodowisko", _Srodowisko)
String _Port = testRunner.testCase.testSuite.getPropertyValue("Port")
testRunner.testCase.setPropertyValue("port", _Port)
String _KodSprzedawcy = testRunner.testCase.testSuite.getPropertyValue("KodSprzedawcy")
testRunner.testCase.setPropertyValue("kodSprzedawcy", _KodSprzedawcy)
String _LiczbaKredytobiorcow = testRunner.testCase.testSuite.getPropertyValue("LiczbaKredytobiorcow")
testRunner.testCase.setPropertyValue("liczbaKredytobiorcow", _LiczbaKredytobiorcow)

//Pobranie z TestCase informacji o parametrach systemowych
testRunner.gotoStepByName("Parametry_transfer")
testRunner.runTestStepByName("Parametry_transfer")

//Utorzenie sprawy kredytowej, sprawdzenie czy sprawa został utworzona, wniosek wpadł na status "Wnioskowany kredyt" oraz pobrano ID sprawy kredytowej
testRunner.testCase.setPropertyValue("czyPowodzenie", 'false')

i = counterStart
while(testRunner.testCase.getPropertyValue("czyPowodzenie") != 'true')
{
	testRunner.gotoStepByName("UtworzSprawe")
	testRunner.runTestStepByName("UtworzSprawe")
	testRunner.gotoStepByName("UtworzSprawe_transfer")
	testRunner.runTestStepByName("UtworzSprawe_transfer")

	testRunner.testCase.setPropertyValue("licznik", i.toString())
	i++
	if(i > 5)
	{
		break
	}
}

counter = testRunner.testCase.getPropertyValue("licznik").toInteger()
if( counter < 5)
{
	testRunner.testCase.setPropertyValue("status", 'TWNIO')
	testRunner.testCase.setPropertyValue("wTrakciePrzetwarzania", 'true')
	testRunner.testCase.setPropertyValue("wTrakcieWeryfikacji", 'true')

	i = counterStart
	while(testRunner.testCase.getPropertyValue("status") != 'WKRED' || testRunner.testCase.getPropertyValue("wTrakciePrzetwarzania") != 'false' || testRunner.testCase.getPropertyValue("wTrakcieWeryfikacji") != 'false')
	{
		testRunner.gotoStepByName("Pauza")
		testRunner.runTestStepByName("Pauza")
		testRunner.gotoStepByName("PobierzStatusySpraw")
		testRunner.runTestStepByName("PobierzStatusySpraw")
		testRunner.gotoStepByName("PobierzStatusSprawy_transfer")
		testRunner.runTestStepByName("PobierzStatusSprawy_transfer")

		testRunner.testCase.setPropertyValue("licznik", i.toString())
		i++
		if(i > 30)
		{
			break;
		}
	}

	counter = testRunner.testCase.getPropertyValue("licznik").toInteger()
	if(counter < 30)
	{
		//Przeprocesowanie wniosku przez status "Wnioskowany kredyt" i sprawdzenie czy wniosek wpadł na status "Dane podstawowe kredytobiorców"
		testRunner.gotoStepByName("WnioskowanyKredyt")
		testRunner.runTestStepByName("WnioskowanyKredyt")

		testRunner.gotoStepByName("ZakonczWnioskowanyKredyt")
		testRunner.runTestStepByName("ZakonczWnioskowanyKredyt")

		i = counterStart
		while(testRunner.testCase.getPropertyValue("status") != 'DPODS' || testRunner.testCase.getPropertyValue("wTrakciePrzetwarzania") != 'false' || testRunner.testCase.getPropertyValue("wTrakcieWeryfikacji") != 'false')
		{
			testRunner.gotoStepByName("Pauza")
			testRunner.runTestStepByName("Pauza")
			testRunner.gotoStepByName("PobierzStatusySpraw")
			testRunner.runTestStepByName("PobierzStatusySpraw")
			testRunner.gotoStepByName("PobierzStatusSprawy_transfer")
			testRunner.runTestStepByName("PobierzStatusSprawy_transfer")

			testRunner.testCase.setPropertyValue("licznik", i.toString())
			i++
			if(i > 30)
			{
				break;
			}		
		}
		counter = testRunner.testCase.getPropertyValue("licznik").toInteger()
		if(counter < 30)
		{
			//Przeprocesowanie wniosku przez status "Dane podstawowe kredytobiorców" i sprawdzenie czy wniosek wpadł na status "Dane szczegółowe kredytobiorców"
			def _KB1_wiek = testRunner.testCase.testSuite.getPropertyValue("KB1_wiek")
			testRunner.testCase.setPropertyValue("kb1_wiek", _KB1_wiek)

			def _KB2_wiek = testRunner.testCase.testSuite.getPropertyValue("KB2_wiek")
			testRunner.testCase.setPropertyValue("kb2_wiek", _KB2_wiek)

			testRunner.gotoStepByName("KB1_PESEL")
			testRunner.runTestStepByName("KB1_PESEL")

			if(testRunner.testCase.getPropertyValue("liczbaKredytobiorcow") == '2')
			{
				testRunner.gotoStepByName("KB2_PESEL")
				testRunner.runTestStepByName("KB2_PESEL")
			}

			testRunner.gotoStepByName("PESEL_transfer")
			testRunner.runTestStepByName("PESEL_transfer")

			testRunner.gotoStepByName("KB1_DOWOD_OSOBISTY")
			testRunner.runTestStepByName("KB1_DOWOD_OSOBISTY")

			if(testRunner.testCase.getPropertyValue("liczbaKredytobiorcow") == '2')
			{
				testRunner.gotoStepByName("KB2_DOWOD_OSOBISTY")
				testRunner.runTestStepByName("KB2_DOWOD_OSOBISTY")
			}

			testRunner.gotoStepByName("DOWOD_OSOBISTY_transfer")
			testRunner.runTestStepByName("DOWOD_OSOBISTY_transfer")

			if(testRunner.testCase.getPropertyValue("liczbaKredytobiorcow") == '1')
			{
				testRunner.gotoStepByName("KredytobiorcyDanePodstawowe_1KBca")
				testRunner.runTestStepByName("KredytobiorcyDanePodstawowe_1KBca")
			}
			else if(testRunner.testCase.getPropertyValue("liczbaKredytobiorcow") == '2')
			{
				testRunner.gotoStepByName("KredytobiorcyDanePodstawowe_2KBcow")
				testRunner.runTestStepByName("KredytobiorcyDanePodstawowe_2KBcow")	
			}

			testRunner.gotoStepByName("PrzygotujDokumenty")
			testRunner.runTestStepByName("PrzygotujDokumenty")	

			testRunner.gotoStepByName("PrzygotujDokumenty_transfer")
			testRunner.runTestStepByName("PrzygotujDokumenty_transfer")	

			testRunner.gotoStepByName("PobierzDokument")
			testRunner.runTestStepByName("PobierzDokument")	

			testRunner.gotoStepByName("ZakonczKredytobiorcyDanePodstawowe")
			testRunner.runTestStepByName("ZakonczKredytobiorcyDanePodstawowe")

			i = counterStart
			while(testRunner.testCase.getPropertyValue("status") != 'DSZCZ' || testRunner.testCase.getPropertyValue("wTrakciePrzetwarzania") != 'false' || testRunner.testCase.getPropertyValue("wTrakcieWeryfikacji") != 'false')
			{
				testRunner.gotoStepByName("Pauza")
				testRunner.runTestStepByName("Pauza")
				testRunner.gotoStepByName("PobierzStatusySpraw")
				testRunner.runTestStepByName("PobierzStatusySpraw")
				testRunner.gotoStepByName("PobierzStatusSprawy_transfer")
				testRunner.runTestStepByName("PobierzStatusSprawy_transfer")

				testRunner.testCase.setPropertyValue("licznik", i.toString())
				i++
				if(i > 30)
				{
					break;
				}		
			}
		}
	}
}

